import React from 'react';
import "./Inicio.css"; 
import Menu from "../../Menu";

const Inicio = () => {
  return (
    <div>
      <Menu />
      <div className="Titulos">
        <h1 classname="title">Bom dia</h1>
        <h1 classname="title">Lídia Ribeiro</h1>
      </div>
      
      {/* aqui você pode adicionar outros componentes e conteúdo */}
    </div>
  );
};

export default Inicio;
